import React, { useEffect } from "react";
import { useFetch } from "../../hooks.js/useFetch";
import Styles from "./Admin.module.scss";
import { Link, NavLink, Route, Routes } from "react-router-dom";
import { LoadingSpinner } from "../../elements/loadingSpinner/loadingSpinner";

const Admin = () => {
  const { loading, response, error } = useFetch({
    url: "http://127.0.0.1:4000/api/v1/forms/",
    method: "get",
  });

  return (
    <div className={Styles.container}>
      <div className={Styles.header}>
        <NavLink activeClassName={Styles.active} to="photos">
          Формы с фото
        </NavLink>
        <NavLink activeClassName={Styles.active} to="consultations">
          Формы с консультациями
        </NavLink>
      </div>
      {loading ? (
        <div className={Styles.spinnerBox}>
          <LoadingSpinner />
        </div>
      ) : (
        // response.forms.photoForms.map((form) => (
        <Routes>
          <Route path="/photos" element={<PhotoAttachments />} />
          <Route path="/consultations" element={<p>b</p>} />
        </Routes>
      )}
    </div>
  );
};

export default Admin;
